import React, { Component } from 'react';
import '../App.css';
import About from '../Components/About.js';
import Skills from '../Components/Skills.js';


class App extends Component {

render() {
return (
    <main>
      <div className="App"> 
        <div className='About'>
          <About />
        </div>

        <div className='Skills'>
            <header header="skills"/>
            <Skills />
        </div>
    </div>
  </main>
  );
}
}
export default App;
